Movie Info: Emo Gurram Egaravachu (English: Who Knows, The Horse may fly) is a 2013 Telugu film directed by Chandra Siddhartha which is also known by its abbreviation EGE. It features Sumanth and Pinky Sawika Chaiyadech in the lead roles where the latter marks her Debut in Telugu Cinema through this film and the Former's second film with Chandra Siddhartha after the 2007 Super Hit Telugu film Madhumasam. Popular film director Madan produced this film on Aa Naluguru Films Pvt Ltd banner and he himself provided the screenplay and dialogues while S. S. Kanchi provided the story of the film. M. M. Keeravani provided the Music for this film. Being the first Indian film whose audio launch happened in Bangkok, The film was awarded a U/A Certificate from Central Board of Film Certification on December 17, 2013.


